import { GoChevronDown, Go } from "react-icons/go";
import { GrEdit } from "react-icons/gr";
import { TiDeleteOutline } from "react-icons/ti";

function WaitingParty({ name, size, phoneNumber, quotedTime, notes }) {
  const iconProperties = "float-right text-xl cursor-pointer ml-5 mr-5";

  return (
    <div className="box-border bg-purple-300 m-5 p-5">
      <span className="text-2xl">
        {name} {size} {phoneNumber} {quotedTime} {notes}
      </span>
      <GoChevronDown className={iconProperties} />
      <GrEdit className={iconProperties} />
      <TiDeleteOutline className={iconProperties} />
    </div>
  );
}

export default WaitingParty;
